function 攻击时移动(慢速度, 快速度)
{
	if(_parent._name != _root.控制目标 ){
		_parent.移动(_parent.方向,慢速度);
		return;
	}
	if (_parent.方向 == "右")
	{
		if (!isNaN(快速度) && Key.isDown(_parent.右键))
		{
			_parent.移动("右",快速度);
		}
		else if (!isNaN(快速度) && Key.isDown(_parent.左键))
		{
			_parent.移动("左",快速度);
		}
		else
		{
			_parent.移动("右",慢速度);
		}
	}
	else if (_parent.方向 == "左")
	{
		if (!isNaN(快速度) && Key.isDown(_parent.左键))
		{
			_parent.移动("左",快速度);
		}
		else if (!isNaN(快速度) && Key.isDown(_parent.右键))
		{
			_parent.移动("右",快速度);
		}
		else
		{
			_parent.移动("左",慢速度);
		}
	}
}

