onClipEvent(load){
	子弹属性 = _root.子弹属性初始化(this);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 3;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战联弹";
	子弹属性.子弹威力 =  _parent._parent.空手攻击力 * 1;
	if(_parent._parent.mp攻击加成){
		子弹属性.子弹威力 += _parent._parent.mp攻击加成;
	}
	if(_parent._parent.被动技能.拳脚空中连招 && _parent._parent.被动技能.拳脚空中连招.等级){
		子弹属性.子弹威力 +=  _parent._parent.空手攻击力 *  _parent._parent.被动技能.拳脚空中连招.等级 / 10;
	}
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 1;
	子弹属性.暴击倍率 = 1;
	if(_parent.蓄力){
		子弹属性.霰弹值 += Math.floor(_parent.蓄力 / 10);
		if(_parent.蓄力 >= 20){
			子弹属性.暴击倍率 = 3 + Math.floor(_parent.蓄力 / 10);
			子弹属性.击倒率 = 0.1;
		}else{
			子弹属性.暴击倍率 = 1.5 + Math.floor(_parent.蓄力 / 10);
		}
	}
	子弹属性.暴击 = function(当前子弹)
		{
				_root.gameworld[当前子弹.发射者名].攻击目标 = 当前子弹.hitTarget._name;
				return 当前子弹.暴击倍率;
		};
	子弹属性.水平击退速度 = 20;

	//非常用
	/*
	子弹属性.水平击退速度 = NaN;
	子弹属性.垂直击退速度 = NaN;
	子弹属性.发射效果 = "";
	子弹属性.击中地图效果 = "火花".
	子弹属性.击中后子弹的效果 = "".
	子弹属性.命中率 = NaN.
	子弹属性.固伤 = NaN;
	子弹属性.百分比伤害 = NaN;
	子弹属性.血量上限击溃 = NaN;
	子弹属性.防御粉碎 = NaN;
	*/
	子弹属性.区域定位area = this.area;
	/*
	//已初始化内容，通常不需要重复赋值，可注释掉
	子弹属性.发射者 = 子弹属性.发射者.
	子弹属性.shootX = 子弹属性.shootX;
	子弹属性.shootY = 子弹属性.shootY;
	子弹属性.shootZ = 子弹属性.shootZ;
	子弹属性.子弹敌我属性 = 子弹属性.子弹敌我属性;
	*/
	_root.子弹区域shoot传递(子弹属性);
}

