	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "裂地拳";
	var 滞空时间加成 = Math.max(Math.min((_parent.滞空时间 - 8) * 2,60),0);
	子弹属性.子弹威力 =  _parent._parent.空手攻击力 + _parent._parent.空手攻击力 *  滞空时间加成 /2;
	if(_parent._parent.mp攻击加成){
		子弹属性.子弹威力 += _parent._parent.mp攻击加成;
	}
	if(_parent._parent.被动技能.裂地拳 && _parent._parent.被动技能.裂地拳.等级){
		子弹属性.子弹威力 +=  _parent._parent.空手攻击力 *  _parent._parent.被动技能.裂地拳.等级 / 10;
	}
	子弹属性.子弹威力 += _parent._parent.空手攻击力 * Math.min((_parent._parent.重量 + _parent._parent.身高 - 105)/100 , 2);
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 50;
	子弹属性.击倒率 = 0.01;

	子弹属性.水平击退速度 = 0;
	子弹属性.击中地图效果 = "";
	子弹属性.击中后子弹的效果 = "";
	子弹属性.不偏转射击角 = true;
	//非常用
	/*
	子弹属性.垂直击退速度 = NaN;
