onClipEvent (enterFrame) {

	if (_parent._parent.hp > 0 && _parent._parent._name == _root.控制目标)
	{
		if (_parent._parent.技能名 == "裂地拳")
		{
			_parent._parent.技能名 = "";
			_parent._parent.浮空 = true;
			_parent.落地 = false;
			_parent.gotoAndPlay("空中落地攻击");
		}
		// 按下攻击键J后触发
		else if (Key.isDown(_parent._parent.A键))
		{
			if (_parent._parent.被动技能.升龙拳 && _parent._parent.被动技能.升龙拳.启用)
			{
				_parent.gotoAndPlay("上勾拳");
			}
			else
			{
				_parent.gotoAndPlay("空中攻击");
			}

		}
		else if (Key.isDown(_parent._parent.B键))
		{
			if (_parent._parent.被动技能.裂地拳 && _parent._parent.被动技能.裂地拳.启用 && !_parent.跳跃过去按键)
			{
				_parent.gotoAndPlay("空中落地攻击");
			}
			_parent.跳跃过去按键 = true;
		}
		else
		{
			_parent.跳跃过去按键 = false;
		}
	}
}
