onClipEvent (load) {
	_parent.当前初始帧 = _parent._currentframe;
	if (!_parent.落地 && _parent._currentframe == _parent.当前初始帧)
	{
		_parent.stop();
		_parent._parent.刚体 = true;
	}
	this.onUnload = function()
	{
		_parent.跳跃移动倍率 = 1;
		//_parent._parent.刚体 = false;
		_parent.play();
	};
}
onClipEvent (enterFrame) {
	_parent._parent.刚体 = true;
	if (_parent.落地 || _parent._currentframe != _parent.当前初始帧)
	{
		_parent.play();
	}
	else
	{
		_parent.滞空时间 += 1;
		if (_parent.跳跃移动倍率 > 0.5)
		{
			_parent.跳跃移动倍率 -= 0.2;
			_parent._parent.垂直速度 += 1;
		}
	}
}
